@cnettel @ruostu okay but

why

why would you, an evil overlord, plausibly deniably un-like a tiny fraction of the likes on a tweet you hate while leaving the tweet entirely accessible and the account unpunished

if you’re getting an error message that you’re IP blocked from discord:

- it’s a technical hiccup happening to thousands of people, and will presumably be fixed (you’re not actually banned) 

- switching from the desktop app to the web app or mobile should get you in
